import { useEffect } from "react"


const Header = () => {
    let time = Date.now()

    useEffect(() => {
        const interval = setInterval(() => {
            time = Date.now()
        }, 1000);
    }, [])

    return (
        <h1> {time} </h1>
    )
}

export default Header
